import React from 'react';
import './Navigation.css';
import Search from './Search';
import $ from 'jquery';
import {Link} from 'react-router-dom';

$(document).ready(function(){
    
    $('#search').click(function(e){
        e.preventDefault();
        $('.menu-item').toggleClass('hide-item');
    })
})


function Navigation(){

    return(
        <div className="navigation">
        <div className="menu">
        <ul>
        <li><Link to="/" className="fa fa-eye"></Link></li>
            <li><Link to="/" className="menu-item">Movies</Link></li>
            <li><Link to="/" className="menu-item">TV Series</Link></li>
            <li><Link to="/" className="menu-item">People</Link></li>
            <li><Link to="/" className="menu-item">Collections</Link></li>
            <li><Link to="/" className="menu-item">Trending</Link></li>
            <li><Link to="/" id='search'className="fa fa-search"></Link></li>
            
            


        </ul>
        <Search />
        </div>
        </div>
    )
};

export default Navigation;
